import React from 'react'
import './Header_mobile.css'
import {FaBars} from "react-icons/all";

const Header_mobile =()=>{
    return(
        <div className='header container mx-auto'>
            <FaBars className='tab-icon my-auto'/>
        </div>
    )
}
export default Header_mobile
